import React from 'react'
import {
  ThemeProvider,
  theme,
  ColorModeProvider,
  CSSReset,
} from '@chakra-ui/core'
import './App.css'
import { SignIn } from './pages'

function App() {
  return (
    <ThemeProvider theme={theme}>
      <ColorModeProvider>
        <CSSReset />
        <SignIn />
      </ColorModeProvider>
    </ThemeProvider>
  )
}

export default App
